import React, { Component } from "react";
import Starback from "./Starback";
import thesis from "../thesiscomponents";
import { Link } from "react-router-dom";

export default class Stars extends Component {
  state = {
    projects: thesis
  };
  render() {
    const myProjects = this.state.projects;

    return (
      <div>
        <div className="gridmaincontainer">
          <div className="b1 box"></div>

          <div>
            {myProjects.map(eachProject => {
              return (
                <div className="projectTitleBox" key={eachProject.id}>
                  <Link
                    className={eachProject.titleClass}
                    to={`/projects/${eachProject.id}`}
                  >
                    {eachProject.name}
                  </Link>

                  <hr />
                </div>
              );
            })}
          </div>
        </div>
      </div>
    );
  }
}
